    return (
    <>
        <Header />
  
      <Container fluid>
        <Row>
          <Col xs={2}>
            <Menu/>
            <Ads/>
          </Col>
          <Col xs={9}>
             <PostsList/> 
           </Col> 
           {/* <Col xs={4}>
              <ProfileSectionContainer/> 
               <RecentFollowers /> 
           </Col>  */}
        </Row>
      </Container>
    </>
    );
  };
  export default profileContainer;
